class UpLoadDocumentPage extends Component {
    state = {  }
    render() { 
        return ( 
            <div className="container">
                <div className="d-inline-block col-4 bg-light">
                    <div className="container">
                        <button className="d-inline btn btn-lg btn-dark">Choose file</button>
                        <p className="d-inline ml-3">Display pdf name</p>
                    </div>
                </div>
                <div className="d-inline-block col-8 bg-primary">hi</div>
            </div>
         );
    }
}
 
export default UpLoadDocumentPage;
